import Title from "./Title";
import Subtitle from "./Subtitle";

export default function Header() {
  const headerStyle = {
    position: "relative",
    color: "#fff",
    height: "890px",
  };

  return (
    <>
      <section className="section header" style={headerStyle}>
        <Background />
        <Nav
        // name={canine.name}
